def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":

    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks: List[Block] = []
    new_items: List[np.ndarray] = []

    for label, group in data:
        if pd.api.types.is_nullable_dtype(group.dtype):
            # Handle nullable data separately
            result = group.mean(skipna=True, min_count=min_count)
        elif np.issubdtype(group.dtype, np.number):
            result = group.agg(how)
        else:
            raise TypeError(f"Unsupported dtype for aggregation: {group.dtype}")

        if pd.isna(result):
            result = np.nan
        agg_blocks.append(result)
        new_items.append(np.array([label]))

    # Construct the resulting data blocks
    # ...

    return agg_blocks, agg_items
